/* Flattened Modelica model:

function IDEAS.BoundaryConditions.SolarGeometry.BaseClasses.solarAzimuthNoEvent
discrete input Real solAziTem(unit = "rad", displayUnit = "deg") "Temporary solar azimuth";
discrete input Real solTim(unit = "s") "Solar time";
discrete input Real day(unit = "s") "Number of seconds in day";
discrete output Real solAzi(unit = "rad", displayUnit = "deg") "Solar azimuth";

algorithm 
if (noEvent(solTim-integer(solTim/day)*day < 43200)) then 
solAzi :=  -solAziTem;
else
solAzi := solAziTem;
end if;
end IDEAS.BoundaryConditions.SolarGeometry.BaseClasses.solarAzimuthNoEvent;

  */
